import React from "react";
import { useNavigate } from "react-router-dom";

export default function Final() {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        minHeight: "100vh", // Set the minimum height of the container to full viewport height
        textAlign: "center",
        padding: "0 20px",
      }}
    >
      <div>
        <h1 style={{ fontFamily: "Roboto", fontSize: "clamp(20px, 5vw, 30px)", fontWeight: "bold", marginBottom: "10px" }}>
          Learning paths based on your answers
        </h1>
        <p style={{ fontFamily: "Roboto", fontSize: "clamp(16px, 4vw, 20px)", fontWeight: 500, color: "#6b7280" }}>
          Choose one to get started. You can switch anytime.
        </p>
      </div>
    </div>
  );
}
